function fr=read_frcal1_mmp(mmpid, calid)%   Usage: fr=read_frcal1_mmp(mmpid, calid);%     inputs%       mmpid is string name of mmp vehicle%       calid is string identifying which calibration to use%     outputs%         fr: reference frequency in Hz%   Function:%      Read reference frequency of mmp vehiclemmpfolders;source_file=[mmpdatabase filesep 'cal' filesep 'fr' filesep mmpid];fid=fopen(source_file,'r');if (fid <= 2)	msg=['read_frcal1_mmp: file missing for mmpid=' mmpid ...	     ' and calid=' calid];	disp(msg)	test=0;else 	test=1;	while test==1		id=fscanf(fid,'%s',1);		fr=fscanf(fid,'%s',1);		if isempty(id)==1			msg=['read_frcal1_mmp: calid=' calid ' not found in ' ...			     'cal file for ' mmpid];			disp(msg)			break		elseif strcmp(id,calid)==1			test=2;			break		end	endendfclose(fid);if test==2	fr=str2num(fr);end